import React from "react";
import Data from "../../data/line_Chart_Data.json";
import {
  ResponsiveContainer,
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Legend,
} from "recharts";
const LineChartDiagram = () => {
  return (
    <>
      <ResponsiveContainer width="100%" aspect={3}>
        <LineChart
          data={Data}
          width={500}
          height={300}
          margin={{ top: 5, right: 5, left: 5, bottom: 5 }}
        >
          <CartesianGrid strokeDasharray="5 5" />
          <XAxis dataKey="name" interval={"preserveStartEnd"} />
          <YAxis />
          <Legend />
          <Line dataKey="student" stroke="red" />
          <Line dataKey="fees" stroke="green" />
        </LineChart>
      </ResponsiveContainer>
    </>
  );
};

export default LineChartDiagram;
